import { Link } from "react-router-dom";
import "./login.scss";

const Login = () => {
   return (
      <div className="login">
         <div className="card">
            <div className="left">
               <h1>Never give up</h1>
               <p>Everyday is a chance to get better.</p>
               <span>Don't you have an account?</span>
               <Link to="/register">
                  <button>Register</button>
               </Link>
            </div>
            <div className="right">
               <h1>Login</h1>
               <form>
                  <input
                     type="text"
                     placeholder="Username"
                     name="username"
                     //   onChange={handleChange}
                  />
                  <input
                     type="password"
                     placeholder="Password"
                     name="password"
                     //   onChange={handleChange}
                  />
                  {/* {err && err} */}
                  <button>Login</button>
               </form>
            </div>
         </div>
      </div>
   );
};

export default Login;
